import React, { Component } from "react";
import "./components.css";
import BackButton from "./components/BackButton";
import TopNav from "./components/TopNav";
import BottomNav from "./components/BottomNav";
import AddIcon from "@material-ui/icons/Add";
import Button from "@material-ui/core/Button";

import Checkbox from "@material-ui/core/Checkbox";

class PageGoalCategoryCustom extends Component {
  state = {};
  render() {
    return (
      <div>
        <TopNav></TopNav>
        <BackButton></BackButton>
        <div className="body">
          <Button
            size="large"
            variant="outlined"
            color="default"
            startIcon={<AddIcon />}
          >
            {"Health"}
          </Button>
          <Button
            size="large"
            variant="outlined"
            color="default"
            startIcon={<AddIcon />}
          >
            {"Health"}
          </Button>
          <Button
            size="large"
            variant="outlined"
            color="default"
            startIcon={<AddIcon />}
          >
            {"Health"}
          </Button>
          <Button
            size="large"
            variant="outlined"
            color="default"
            startIcon={<AddIcon />}
          >
            {"Health"}
          </Button>
          <Button
            size="large"
            variant="outlined"
            color="default"
            startIcon={<AddIcon />}
          >
            {"Health"}
          </Button>
          <Button
            size="large"
            variant="outlined"
            color="default"
            startIcon={<AddIcon />}
          >
            {"Health"}
          </Button>
        </div>
        <BottomNav></BottomNav>
      </div>
    );
  }
}

export default PageGoalCategoryCustom;
